css:
@-moz-document domain("delicious.com") {
body {
  background: #f0f0f0 !important;
  }
  
.sidebar,
.sidebar .site-nav .site-nav-links,
.dropdown.open .dropdown-toggle,
.dropdown-menu {
    background: #32394a !important;
	}
 
.item .title {
	color: #000 !important;
	}
 
.site-nav-links li.on a {
    color: gray !important;
	background: #1d222c !important;
	}
        
.site-nav-search form .search-bar-tip{
    background: #32394a !important;
    }
 
.site-nav-search.on input, .site-nav-search:focus input {
	background-color:#505357 !important;
	color:#9dc9f5 !important;
	}        
  
.sidebar a:hover,.dropdown-menu a:hover {
	background-color:#1d222c !important;
	}
.site-nav-search input {
background: #505255 !important;
	}

.sponsored-link, .taboola-feed-ads-outer{display:none!important}
}
